struct usort {
	double u;
	int i;
	int j;
	int si;
	int sj;
	int ei;
	int ej;
	int ni;
	int nj;
	double sg;
};
int compare_uws(const void *X1, const void *X2)
{
	// &&&&&&&&&&&&&&&&&&&&&&&&&&&77
	struct usort *S1 = (struct usort *)X1;
	struct usort *S2 = (struct usort *)X2;
	if (fabs(S1->u) - fabs(S2->u) == 0)
	{
		if (abs(S1->si) - abs(S2->si) < 0)return -1;
		if (abs(S1->si) - abs(S2->si) > 0)return 1;
		if (abs(S1->ei) - abs(S2->ei) < 0)return -1;
		if (abs(S1->ei) - abs(S2->ei) > 0)return 1;
		if (abs(S1->ni) - abs(S2->ni) < 0)return -1;
		if (abs(S1->ni) - abs(S2->ni) > 0)return 1;
	}
	if (fabs(S1->u) - fabs(S2->u) < 0)return 1;
	if (fabs(S1->u) - fabs(S2->u) > 0)return -1;
	return 0;
}
